import React, {useEffect} from "react"
import {Link, useParams} from "react-router-dom"


function Deck({fnObj, studyDeck}){
  const {deckId}=useParams()


  useEffect(()=>{
    fnObj.studyDeckSetter(deckId)
  }, [])

  return <div>in Deck</div>
}

export default Deck;
